INSERT INTO `book` (`id`, `title`, `img`, `description`, `ISBN`, `author`, `publicationdate`, `userId`) VALUES
(2, 'Diary of a Wimpy Kid', , 'Greg Heffley finds himself thrust into a new year and a new school where undersize weaklings share the corridors with kids who are taller, meaner and already shaving.\r\n\r\n\r\nDesperate to prove his new found maturity, which only going up a grade can bring, Greg is happy to have his not-quite-so-cool sidekick, Rowley, along for the ride. But when Rowley\'s star starts to rise, Greg tries to use his best friend\'s popularity to his own advantage. Recorded in his diary with comic pictures and his very own words, this test of Greg and Rowley\'s friendship unfolds with hilarious results.', '978-1439582633', 'Jeff', '2007-01-04', 6);
INSERT INTO `book` (`id`, `title`, `img`, `description`, `ISBN`, `author`, `publicationdate`, `userId`) VALUES
(3, 'Twilight', , 'Isabella Swan\'s move to Forks, a small, perpetually rainy town in Washington, could have been the most boring move she ever made. But once she meets the mysterious and alluring Edward Cullen, Isabella\'s life takes a thrilling and terrifying turn.\r\n\n\r\nUp until now, Edward has managed to keep his vampire identity a secret in the small community he lives in, but now nobody is safe, especially Isabella, the person Edward holds most dear. The lovers find themselves balanced precariously on the point of a knife -- between desire and danger.', '978-0316015844', 'Stephenie Meyer', '2006-06-09', 6);
INSERT INTO `book` (`id`, `title`, `img`, `description`, `ISBN`, `author`, `publicationdate`, `userId`) VALUES
(4, 'Pride and Prejudice', , 'Since its immediate success in 1813, Pride and Prejudice has remained one of the most popular novels in the English language. Jane Austen called this brilliant work \"her own darling child\" and its vivacious heroine, Elizabeth Bennet, \"as delightful a creature as ever appeared in print.\" The romantic clash between the opinionated Elizabeth and her proud beau, Mr. Darcy, is a splendid performance of civilized sparring. And Jane Austen\'s radiant wit sparkles as her characters dance a delicate quadrille of flirtation and intrigue, making this book the most superb comedy of manners of Regency England.', '978-0141439518', 'Jane Austen', '1813-01-28', 6);
INSERT INTO `book` (`id`, `title`, `img`, `description`, `ISBN`, `author`, `publicationdate`, `userId`) VALUES
(5, 'The Greate Adventure of Sherlock Homes', , 'From the strange case of \'The Red-Headed League\' to the extraordinary tale of \'The Engineer\'s Thumb\', Sherlock Holmes and his assistant Dr Watson grapple with treachery, murder, and ingenious crimes of all kinds. But no case is too challening for the immortal detective\'s unique power of deduction.', '978-0141332499', 'Sir', '2014-06-09', 9);
INSERT INTO `book` (`id`, `title`, `img`, `description`, `ISBN`, `author`, `publicationdate`, `userId`) VALUES
(7, 'Red, White & Royal Blue', , 'First Son Alex Claremont-Diaz is the closest thing to a prince this side of the Atlantic. With his intrepid sister and the Veep’s genius granddaughter, they’re the White House Trio, a beautiful millennial marketing strategy for his mother, President Ellen Claremont. International socialite duties do have downsides—namely, when photos of a confrontation with his longtime nemesis Prince Henry at a royal wedding leak to the tabloids and threaten American/British relations. The plan for damage control: staging a fake friendship between the First Son and the Prince.\r\n\r\nAs President Claremont kicks off her reelection bid, Alex finds himself hurtling into a secret relationship with Henry that could derail the campaign and upend two nations. What is worth the sacrifice? How do you do all the good you can do? And, most importantly, how will history remember you? ', '', 'Casey', '2019-05-14', 6);
INSERT INTO `book` (`id`, `title`, `img`, `description`, `ISBN`, `author`, `publicationdate`, `userId`) VALUES
(20, 'The Wolf at the Door', , 'A former FBI agent is partnered with the enemy in this suspenseful male/male shifter romance from debut author Charlie Adhara.\r\n\r\nHunting for big bad wolves was never part of Agent Cooper Dayton’s plan, but a werewolf attack lands him in the carefully guarded Bureau of Special Investigations. A new case comes with a new partner: ruggedly sexy werewolf Oliver Park.\r\n\r\nPark is an agent of The Trust, a werewolf oversight organization working to ease escalating tensions with the BSI. But as far as Cooper’s concerned, it’s failing. As they investigate a series of mysterious deaths unlike anything they’ve seen, every bone in Cooper’s body is suspicious of his new partner—even when Park proves himself as competent as he is utterly captivating.\r\n\r\nWhen more people vanish, pressure to solve the case skyrockets. And though he’d resolved to keep things professional, Cooper’s friction with Park soon erupts…into a physical need that can’t be contained or controlled. But with a body count that’s rising by the day, werewolves and humans are in equal danger. If Cooper and Park don’t catch the killer soon, one—or both—of them could be the next to go.\r\n', '9781378095416', 'Charlie Adhara', '2018-02-19', 6),
(21, 'The Wolf at Bay', , 'Going home digs up bad memories, so it’s something Bureau of Special Investigations agent Cooper Dayton tries to avoid. When he’s guilted into a visit, Cooper brings along Oliver Park, his hot new werewolf partner, in the hopes the trip will help clarify their status as a couple…or not.\r\n\r\nWhen Park’s keen shifter nose uncovers a body in the yard and Cooper’s father is the prime suspect, Cooper knows they’re on their own. Familial involvement means no sanctioned investigation. They’ll need to go rogue and solve the mystery quietly or risk seeing Cooper’s dad put behind bars.\r\n\r\nThe case may be cold, but Park and Cooper’s relationship heats up as they work. And yet if Cooper can’t figure out what’s going on between them outside of the bedroom, he’ll lose someone he… Well, he can’t quite put into words how he feels about Park. He knows one thing for sure: he’s not ready to say goodbye, though with the real killer inching ever closer…he may not have a choice.\r\n\r\nOne-click with confidence. This title is part of the Carina Press Romance Promise: all the romance you’re looking for with an HEA/HFN. It’s a promise!', '9781488089367', 'Charlie Adhara', '2018-09-24', 6);
INSERT INTO `book` (`id`, `title`, `img`, `description`, `ISBN`, `author`, `publicationdate`, `userId`) VALUES
(22, 'Thrown to the Wolves', , 'Agent Cooper Dayton is going to meet his boyfriend’s werewolf family. Unarmed. On their turf.\r\n\r\nAnd he’s bringing his cat.\r\n\r\nWhen Agent Cooper Dayton agreed to attend the funeral for Oliver Park’s grandfather, he didn’t know what he was getting into. Turns out, the deceased was the alpha of the most powerful werewolf pack on the eastern seaboard. And his death is highly suspicious. Regardless, Cooper is determined to love and support Park the way Park has been there for him.\r\n\r\nBut Park left him woefully unprepared for the wolf pack politics and etiquette. Rival packs? A seating order at the dinner table? A mysterious figure named the Shepherd? The worst is that Park didn’t tell his family one key thing about Cooper. Cooper feels two steps behind, and reticent Park is no help.\r\n\r\nThere are plenty of pack members eager to open up about Park and why Cooper is wrong for him. Their stories make Cooper wonder if he’s holding Park back. But there’s no time to get into it…as lethal tranquilizer darts start to fly, Cooper needs to solve the mystery of the alpha’s death and fight for the man he loves—all before someone else dies.', '9781488089381', 'Charlie Adhara', '2019-04-12', 6);
INSERT INTO `book` (`id`, `title`, `img`, `description`, `ISBN`, `author`, `publicationdate`, `userId`) VALUES
(23, 'Harry Potter and the Chamber of Secrets', , 'The Dursleys were so mean and hideous that summer that all Harry Potter wanted was to get back to the Hogwarts School for Witchcraft and Wizardry. But just as he\'s packing his bags, Harry receives a warning from a strange, impish creature named Dobby who says that if Harry Potter returns to Hogwarts, disaster will strike. And strike it does. For in Harry\'s second year at Hogwarts, fresh torments and horrors arise, including an outrageously stuck-up new professor, Gilderoy Lockhart, a spirit named Moaning Myrtle who haunts the girls\' bathroom, and the unwanted attentions of Ron Weasley\'s younger sister, Ginny. But each of these seem minor annoyances when the real trouble begins, and someone -- or something -- starts turning Hogwarts students to stone. Could it be Draco Malfoy, a more poisonous rival than ever? Could it possibly be Hagrid, whose mysterious past is finally told? Or could it be the one everyone at Hogwarts most suspects... Harry Potter himself', '9780545582926', 'J.K. Rowling', '1998-07-21', 6);
INSERT INTO `book` (`id`, `title`, `img`, `description`, `ISBN`, `author`, `publicationdate`, `userId`) VALUES
(24, 'Murder Takes the High Road', , 'From award-winning male/male author Josh Lanyon: a librarian finds himself in a plot right out of one of his favorite mystery novels\r\n\r\nLibrarian Carter Matheson is determined to enjoy himself on a Scottish bus tour for fans of mystery author Dame Vanessa Rayburn. Sure, his ex, Trevor, will also be on the trip with his new boyfriend, leaving Carter to share a room with a stranger, but he can’t pass up a chance to meet his favorite author.\r\n\r\nCarter’s roommate turns out to be John Knight, a figure as mysterious as any character from Vanessa’s books. His strange affect and nighttime wanderings make Carter suspicious. When a fellow traveler’s death sparks rumors of foul play, Carter is left wondering if there’s anyone on the tour he can trust.\r\n\r\nDrawn into the intrigue, Carter searches for answers, trying to fend off his growing attraction toward John. But as unexplained tragedies continue, the whole tour must face the fact that there may be a murderer in their midst—but who?', '9781459293595', 'Josh Lanyon', '2018-04-23', 6);
INSERT INTO `book` (`id`, `title`, `img`, `description`, `ISBN`, `author`, `publicationdate`, `userId`) VALUES
(25, 'The Shining', , 'ack Torrance’s new job at the Overlook Hotel is the perfect chance for a fresh start. As the off-season caretaker at the atmospheric old hotel, he’ll have plenty of time to spend reconnecting with his family and working on his writing. But as the harsh winter weather sets in, the idyllic location feels ever more remote . . . and more sinister. And the only one to notice the strange and terrible forces gathering around the Overlook is Danny Torrance, a uniquely gifted five-year-old.', '978-0307743657', 'Stephen King', '2012-06-26', 6),
(29, 'Testing', , 'This is for testing', '9781378095416', 'Uyen Ho', '2021-12-14', 6);

