INSERT INTO `review` (`id`, `reviewtitle`, `reviewtext`, `reviewdate`, `userId`, `bookId`) VALUES
(1, 'My brother loves it!!!', 'This book is amazing, it has attractive plot that catch reader attenion. It\'s about witch which seemly a common genre, I thought it would be boring but it\'s not', '2021-09-07', 1, 2),
(2, 'Review', 'This book is quite possibly the most insipid novel I have ever read in my life. Why this book is so highly treasured by society is beyond me. It is 345 pages of nothing. The characters are like wispy shadows of something that could be interesting, the language that could be beautiful ends up becoming difficult to decipher and lead me more than once to skip over entire paragraphs because I became tired of having to stumble through them only to emerge unsatisfied, and the plot is non-existent, as though Austen one day decided she wanted to write a novel and began without having any idea what would happen except that there would be a boy and a girl who seemingly didn’t like each other but in the end got married. The story really probably could have been told in about 8 pages, but Austen makes us slog through 345 pages of mind-numbing balls and dinner-parties. I don’t care what anyone says, this is not great literature. This is a snore.', '2009-01-01', 2, 4),
(3, '', 'well myself and my counterpart on the dumb bitch book club have finally finish this lovely book. i have so many feelings about it, but i wouldn\'t even know where to begin.\r\nprimarily, this book is what got me into fandom culture. i started my first youtube channel solely to discuss twilight, the books and the movies. and edward was my first real crush.\r\nupon reread as a 24 year old adult, its pretty easy to see the faults of this book and its characters. and unfortunately for most of the book i didn\'t feel that strong sense of attachment and nostalgia that i was hoping to feel. but once i read the epilogue it kind of all came rushing back. i\'m so appreciative for this book and what it represents.\r\nbella might be an idiot, but she goes after what she wants. something we could probably all do well to remember.', '2020-08-09', 1, 3),
(4, '', 'I bought this book for my 9 year old son, who had begged me for it relentlessly for over a month. After i got it, i would hear him giggling and laughing in his room, and when i would peek in, he was always reading this book. So when he was done, i picked it up and started reading it myself.... and it really is funny! The voice of the main character is very authentic - a thing which is hard to find. I wish that people had been writing material like this when i was a preteen.', '2021-01-01', 3, 2),
(5, '', 'I seldom give five-star ratings, but I feel the need to balance some of the negative reviews. First of all, this book is intended for slightly older readers--say, 9 and up. Second, anyone looking for profound wisdom will be disappointed. It\'s just a funny book, a very funny book. I\'m not sure I\'d go as far as to call is a graphic novel, either. The doodly illustrations enhance the \"story\" (such as it is), but they don\'t tell it. Jeff Kinney is an obvious disciple of Matt Groening (not Simpsons-Groening, but rather Life-In-Hell-Groening). This book doesn\'t tackle any issues, nor does it try to make the reader a better person; it\'s just fun. ', '2021-01-01', 4, 2),
(11, 'Great!!!!!', 'I love this book', '2021-11-10', 6, NULL),
(13, 'I', 'This book is not good', '2021-11-19', 9, NULL),
(14, 'I', 'This book is about ', '2021-11-19', 9, NULL),
(16, 'Not good', 'Unfortunately this book made for passive reading. I usually love detective novels as they\'re engaging to read and I really enjoy trying to figure out the case as the book goes along and come up with the solution myself. However, the vast majority of Sherlock Holmes\' stories do not allow for this, especially because Holmes\' epiphanies almost always arise from visual clues - something the reader does not have access to due to the stories being written from Watson\'s perspecive. And unlike Agatha Christie\'s detective novels where much of the mystery is solved by analysis of dialogue and matching up of events, these tales rely heavily on what goes on in Holmes\' experiences. Watson isn\'t around Holmes all of the times and seems to be a rather bland character who does not add much to the story apart from being Holmes\' soundboard. The resolutions therefore are often sudden and make the reader\'s attempt to solve the case by themselves futile', '2021-11-28', 9, 2),
(17, 'I love it', 'my name is Uyen', '2021-12-03', 9, 2),
(18, 'I love it', 'This book is quite good', '2021-12-03', 9, NULL),
(19, 'I love it', '1234567788ijmnbgftyujikokjmnbbvbvbvgb', '2021-12-03', 10, 7),
(20, 'I love it', 'wgdfzbfgxn', '2021-12-03', 8, 7),
(21, 'Amazing', 'hhhhsdhufcui Hu uhukzhvk hkhzkdgfvksjzhbdu ', '2021-12-06', 6, NULL),
(22, 'I love it', 'I enjoyed this book because it is packed with action, fantasy and creativity. My favourite part is when Harry is pulled into Riddle’s diary and is made to witness the expulsion of his friend Hagrid when he was at Hogwarts 50 years before.\r\n\r\nThere are not many people who haven’t read this series but I would recommend this to anyone who loves fantastical stories and it is definitely worth 5 stars.', '2021-12-07', 6, 23),
(23, 'Great!!!!!', 'great book. i grew up during the time the books were being released but for some reason never read them at the time. i saw every movie and i loved them all. just recently i decided to start reading, the first one was free as a prime member so i thought \'why not?\'. i asked my friends if i should read them even though i essentially knew what happened because i had seen the movies, they all said yes and they were right. the details are great, it makes you wish certain things from the book made it into the movies. my goal is to at least read a couple more books (it took a month each to finish the first two, just reading when i had some time) this year. it would be even better to finish the complete series but i know the books get longer so we\'ll see about that', '2021-12-07', 6, 23),
(24, 'My daughter love it', 'This is my 8-year old daughter’s second ‘real’ book, as she proudly calls it – as this is a hard cover bound book that is very different than her vast collection of colourful girly picture books. I must say the colourful hard-cover version is actually quite nice and will last subsequent reading when the owner\'s little brother is bound to pick it op in due course.\r\n\r\nOur daughter has seen all the Harry Potter movies, which she thoroughly enjoyed. So she has now started to read the first few books. The books are great and she is quite encouraged to actually pick it up and continue the read - as there is lots of additional Potterish detail and trivia left out from the movies that she is keen to pick up. Given that we got a her an overpriced Hermione wand, she is particularly interested in the spells. And she found a number of entertaining story elements like part of the ‘wizard\'s duel’ that never made it into the movie.\r\n\r\nIn the end the book is highly relatable to kids as it describes the big and small challenges that kids face every day. It shows how the characters deal with unfairness, anxiety and how boring and challenging school can be.', '2021-12-07', 7, 23),
(25, 'I love it', 'Second book in the series is very enjoyable and Harry gets a visit from Dobby the elf. He tries to stop Harry from returning to Hogwarts.\r\nMalloy has it out for any pupil who is not full-blooded magic family. Harry gets blamed as always but manages to save the school from He who shall not be named and it’s time to home for summer.', '2021-12-07', 7, 23),
(26, 'Review', 'My favorite thing about Harry Potter and the Chamber of Secrets is how we get to see that wizards and Muggles are much the same.  Mr. Weasley actually thinks that Muggles are fasinating and even “magical” in their own way.  It’s a nice little theme that I only picked up since it was my third time reading it.  It’s a subtle contrast to the “Muggle-born” hate the goes along with the opening of the Chamber of Secrets.\r\n\r\nAnd enter Lockhart – the fun, semi-villain.  He’s fun to make fun of and laugh at but I think he represents a villan that we are more likely to encounter in real life or even become ourselves if we’re not careful.  He’s selfish, vain and will do anything to get ahead including hurting others.\r\n\r\nHonestly, this book gave me chills when I first read it. I was not expecting what I considered to be a “kids” book to be scary. I had to finish it in one night so I could sleep.  If I didn’t find out how Harry got rid of the voices talking about blood and killing, my subconscious would have no way to fight back in my nightmares.  I have nightmares about everything.\r\n\r\nThe magical world J.K. Rowling has built is so fantastic and unbelievably real that it makes me ask questions like, “Why is Peeves physical when ghosts are not and why is he afraid of the Bloody Baron?”  And I seriously want an answer.  There is no level of detail that is too much in my mind.  I must know all the things about Hogwarts.  And oh how I love Professor Binns.  He’s the ultimate old and boring teacher (another thing that Muggles sadly have, too).\r\n\r\nI really can’t get over how very relatable this book is to kids.  It deals with the big and small struggles that kids go through every day.  It shows how the characters deal with unfairness and how tedious and boring school can be.  And Harry really acts like a kid  – he doesn’t tell Dumbledore important things in the fashion of any kid who is afraid.  Who as a kid didn’t tell their parents something even though they knew they should?\r\n\r\nAfter reading it for the third time, it’s fun to pick up on the foreshadowing that I missed.  I’m noticing that Ms. Rowling often disguises important things as jokes or just another detail to make the world more interesting and colorful.  Ooh I just get chills when they figure out who Moaning Myrtle is.  See? She’s important although at first she appeared to just be a colorful character to annoy them in the bathroom.', '2021-12-07', 7, 23),
(27, 'I love it', 'This book is amazing', '2021-12-08', 6, 23),
(28, '', ' DXA FDZSDCC SDVC', '2021-12-08', 6, 23),
(29, 'I love it', 'Oh my. This book, to me, is like chocolate: a delicious, sinful, addictive indulgence which you convince yourself has beneficial qualities (zinc, calcium, keeps me quiet at that time of the month...) in order to justify your addiction.\r\n\r\nBy \"beneficial qualities\", I mean that it\'s reading, and since when is reading bad? :) Let me say quite clearly that I\'m a sucker for romance, especially the intense, passionate, tragic kind. I don\'t read romance novels*, though, because to me they are lacklustre - Meyer\'s book has the extra edge I need, though, a great way of keeping doom hanging over the main characters\' heads: she\'s human, he\'s a vampire.\r\n\r\nSound corny? Yeah, I know, and the only reason Meyer gets away with it as well as she does is because Twilight doesn\'t try to be anything it\'s not, and it has such conviction. Only Meyer could get away with giving her narrator the name Isabella Swan. She says in her little bio at the back that she wanted to write believable characters: an interesting choice, then, to write about vampires, but I believed in them, and without such a willing suspension of disbelief, the story would have been a farce. True, a lot of people haven\'t been able to suspend their disbelief with this book, but that doesn\'t affect my reading experience :)\r\n\r\nSeventeen year old Bella\'s parents are divorced. She lives with her mum in Phoenix, Arizona, and spends time with her dad Charlie in Forks, Washington State, where it rains almost constantly. She hates Forks, but when her mum remarries a baseball player, Phil, and starts travelling with him, Bella decides to move to Forks.\r\n\r\nOn her first day at school she notices the isolated group of five beautiful, graceful siblings. Rosalie, Alice, Emmet, Edward and Jasper. One in particular catches her eye: Edward Cullen, with his rust-brown hair and topaz eyes. She is more than a little surprised and shocked when he seems to have developed an acute, profound hatred of her. Her fascination deepens, especially when, after a brief disappearance, he saves her life. She soon figures out what Edward is, and the knowledge doesn\'t frighten her. The shaky friendship between them develops into something much stronger, and Edward reveals his overpowering reaction to her smell that nearly made him kill her on the spot - hence the look on his face that so shocked her, and the restraint he put on himself during an hour of Biology.\r\n\r\nLet\'s not forget he\'s incredibly handsome: even though Bella describes almost every glance he makes and every twitch of his lips, not once did I get bored and roll my eyes. My fascination grew alongside hers, until I too fell in love with Edward - in a totally girly, daydreamy way. Yes, I admit it. I don\'t know if that makes this a girly kind of book - these days those boundaries don\'t seem to matter so much, and the vampire family is pretty darn cool, what with Edward\'s extra ability to read minds, Alice\'s premonitions, Jasper\'s ability to affect people\'s emotions, their speed, their invincibility... Bella is at one point compared to Lois Lane, because Edward and his kin really are like Superman.\r\n\r\nOne of the things I love about YA books: the clarity with which they are written. Granted there is some repetition in Twilight, but to me it\'s necessary repetition. There\'s nothing superfluous in Twilight, nothing that shouldn\'t be there, and the flow, the pacing, is great. It\'s a fat book, but I read it in two days. I read it with breakfast, on my walk to the subway, on the subway, up the escalator, through the ticket gates, to work, in my lunch break ... you get the picture. I couldn\'t get enough of it, and it left me with that same craving for more that Harry Potter did (I remember scrounging around for loose change as soon as I finished one of them and dashing off into the city to get my next fix. It helped that four were already out when I started). There\'s plenty of negative stuff you could say about this book - the writing, the characters, the obsession - but again, I couldn\'t care less :)\r\n\r\nAnother thing I loved was all the vampire myths Meyer scrapped. These vampires aren\'t burnt to ash by sunlight: their marble skin glitters as the sunlight is broken into miniscule shards, like diamonds - hence why they are living in Forks, where the sun hardly ever shines. They are not hurt by crucifixes or stakes through the heart. They do not sleep at all, nor do they eat human food. They drive fast cars really really fast. And they can fall in love. Awwww.\r\n\r\nSeriously though, this was one of most fun, most enjoyable, most romantic books I\'ve read in a long time, and I\'m so happy there are two more out with a fourth on the way. They are, somewhat predictably, making Twilight into a movie - still in the early development stage - but it\'s rather fun to go to the author\'s website and see her own preferences for actors to play Edward etc. Can\'t say I\'m familiar with most of them, but her top choice (now sadly too old), is indeed a perfect match. Who knows who they\'ll really cast, but as with the book, the characters have to be right or the whole story will be just silly and sappy.', '2021-12-10', 6, 3),
(30, 'Great!!!!!', 'well myself and my counterpart on the dumb bitch book club have finally finish this lovely book. i have so many feelings about it, but i wouldn\'t even know where to begin.\r\n\r\nprimarily, this book is what got me into fandom culture. i started my first youtube channel solely to discuss twilight, the books and the movies. and edward was my first real crush.\r\n\r\nupon reread as a 24 year old adult, it\'s pretty easy to see the faults of this book and its characters. and unfortunately for most of the book i didn\'t feel that strong sense of attachment and nostalgia that i was hoping to feel. but once i read the epilogue it kind of all came rushing back. i\'m so appreciative for this book and what it represents.\r\n\r\nbella might be an idiot, but she goes after what she wants. something we could probably all do well to remember.', '2021-12-10', 6, 3),
(31, 'I enjoy this book', 'Interesting, creative, imaginative, detailed, and fun to read. Definitely keeps the interest and has you turning pages to see what\'s gonna happen next. Colorful characters, curious mysteries, fun antics and bantering, and simple yet complex answers. Can you figure it out before the end? ;) Enjoyable to read and contains a few shorter stories so it\'s not too much at once. Great for the youngsters and adults alike. Totally Enjoy!', '2021-12-10', 6, 5),
(32, '', 'Arthur Conan Doyle\'s iconic master of logic and detective calculation comes through time and again in the well-known and beloved mysteries of Sherlock Holmes. With Doyle\'s unmatched atmospheric evocation of Victorian London, unforgettable leads, and imaginative mysteries, Sherlock Holmes is delightful', '2021-12-10', 6, 5),
(33, '', 'Extremely delightful to read even though a few of the short stories don’t quite hit the amazing mark. Compared to another anthology I’ve read of Sherlock Holmes, these seemed a bit less clever, but overall it was still fun reading them.', '2021-12-10', 6, 5),
(34, 'Great book', 'This was a great book but for some reason, boring. I didn\'t hate it but I couldn\'t find the \'want\' to read. These mysteries seemed very thought through and I really liked the end of every mystery: you found out what actually happened and Sherlock was never really wrong! I do feel it was written in quite old language (using words like seven-and-thirty instead of thirty-seven) but I did understand what most meant. And if I didn\'t here was always the glossary to help me at the end of the book. Another positive thing is the description. So detailed and I managed to picture whatever was being described. Thanks for the adventure Doyle, John and, of course, Sherlock', '2021-12-10', 7, 5),
(35, 'Simple classic', 'I have to admit that initially it was hard to adjust to the style and also the several plots. The stories, in my opinion, are not as mysterious and as captivating as one might be used to from modern novels, but they all have character. Overall I am eager to immerse myself more into the world of Holmes and Watson! ', '2021-12-10', 7, 5),
(36, 'Best book ever', 'i don\'t even know what to say that hasn\'t already been said about this but lemme give it a shot.\r\n\r\ngod DAMN this is king at his best. i know, i know, \"kat that is so cliche. couldn\'t you have picked a less popular king book to stan?\"\r\n\r\ni guess not, but hear me out.\r\n\r\n1. first of all, i love a good old fashioned haunted house story and that\'s exactly what this is. the slow progression of madness that overtook jack and the introduction of new ghosts (or hallucinations, whatever you decide) was INCREDIBLE. not to mention the thing that i think king writes best is the feeling of confinement, and what\'s more confining than being snowed into a haunted hotel that literally wants you dead?? oh right, nothing.\r\n\r\n2. the characterization!!! ah! the way that king wrote these characters was just *chefs kiss* not only did i care about danny, wendy, and (sometimes) jack, but we also got to rip back the layers of their relationships with each other and dynamic as a family which i LOVE. even if you don\'t think this is a great horror story, don\'t deny it is a baller family drama.\r\n\r\n3. the horror of it all. whether you want to look at it as a family being attacked by ghosts, or a father being overcome by an extreme case of cabin fever, or even if the whole murdering thing doesn\'t scare you but you can see the fear that comes with having a family member who battles with some kind of addiction, this book is fucking scary. it may not have made me physically jump or scream, but i can tell you that it\'s a story that is gonna stick in my brain and not let go for a long long time (just like any good horror should)\r\n\r\nnow for the obligatory comparison to the movie:\r\n\r\nit\'s common knowledge that king himself hates the Kubrick movie, but i love it. so much. it\'s one of the first horror movies i ever saw and i\'ve seen it many times since, so while it\'s a popular opinion to love the book and shit on the movie i just can\'t bring myself to do it. yes, they\'re very different in a lot of ways, but honestly i think that Kubrick did the best with what he had to work with.\r\na BIG part of the novel is rooted in internal conflict. we spend so much time inside of jack, danny, and wendy\'s heads that it would have been impossible (imo) to translate that to the screen without a near constant voiceover (like basically just the audiobook playing over all the scenes) sO, i can\'t fault the movie for what it lacks in depth of character and explanation...i just can\'t. however, if for some reason you\'re reading this and you have seen the movie but haven\'t read the book YOU BETTER READ THE FCKING BOOK ARE YOU JOKING?? READ IT.', '2021-12-10', 7, 25),
(37, 'Excellent book', 'This was most excellent; I can 100% see why this is many readers favorite Stephen King novel. Heck, it\'s my favorite novel of his to date, although I have a good number of his books to catch up on. I\'ve found myself overly critical of his work in the past, possibly due to the fact that he\'s so well known, but I feel it\'s more been a fault on my end. Previously I\'ve picked up one of his doorstops at a time I wasn\'t prepared to fully invest in the time and energy it takes to immerse oneself into his world building and lengthy details. This time, I was ready. (Also, this was only like 600 pages which felt like a novella compared to IT.)\r\n\r\nI\'m finally able to understand why so many people hold the standard of traditional horror in comparison to this novel. Sure, it has all the creepy crawlies and spooky wookies to get your heart racing, but it\'s so grounded in reality that I had a hard time rationalizing with myself that \"it\'s just a story.\" The 150 page set up is well worth the reader\'s time, as it lays the groundwork for much of the why behind the narrative, and it also gave me a chance to bond with precious Danny before the shit hit the fan.\r\n\r\nI may be the last person on the planet to have read this book, but just in case I\'m not, I wanted to share some of the things that really hit home with me. Just like IT is, at heart, a disturbing coming-of-age story, The Shining was an impeccable tale of extreme cabin fever with a hefty dose of \"the destructive nature of alcoholism\". When you break it down like that, the supernatural elements actually seem to take a backseat to the very real horror of what it\'s like living with someone struggling through addiction. I\'ve heard all the stories of how this book helped SK realize his own struggle with alcohol, and I\'m inclined to believe it\'s true as the writing here was heavy laden with emotion and depth.\r\n\r\nI apologize for ever calling Mr. King over-hyped. I\'m grateful my previous experiences with his wordier novels didn\'t deter me from finally choosing to read this, as it\'s a gem of a book and a classic in it\'s genre. I still despise Sleeping Beauties though and refuse to change my opinion on the matter. ;) Highly recommended to any other below-the-rock dwellers who may not have happened across this one. Now- to watch the movie or not?', '2021-12-10', 7, 25),
(38, '', 'About as perfect a haunted house story as can be, King was at his best here.\r\n\r\nIt\'s as though he built a haunted house and then filled every nook and cranny with detail. King is also at his best in regard to characterization, all well rounded and complete, we know family relationships, group dynamics, all the old hidden buried fears.\r\n\r\nKing touches base with psychological elements, theological, metaphysical, spiritual, and cryptic aspects of a ghost story to wrap the reader in a blanket of horror.\r\n\r\n** I watched the 1980 Stanley Kubrik film recently and this made me want to reread the book (which I need to anyway). Kubrik\'s film grasps the psychological elements of the book and delivers an extra large thin crust The Works pizza of haunted house horror. Jack Nicholson\'s portrayal of Jack Torrance is still the defining image of this tortured man. While some critics have derided the slow pace of the film (atypical for jump-out-and-yell-BOO! horror fliks of the time) I felt that Kubrik was building the tone and mood of the story to the grisly final moments. King himself has attributed mixed emotions to the film as an adaptation, but has consistently agreed that the imagery of an internal struggle with the dark side of Jack\'s psyche is a contribution to the horror film genre. King also disagreed with the casting of Nicholson who too closely identified with insanity (due largely to his exceptional work in One Flew Over the Cuckoo\'s Nest). Interestingly, King himself was battling alcoholism while writing the classic and viewing his work and Kubrik\'s vision from this perspective adds greater depth to an understanding and appreciation of both.', '2021-12-10', 7, 25),
(39, '\"You are my partner. My love. My family.\"', 'I\'m still completely and utterly wolfed!!!\r\n\r\nThis one is a bit wolfier than the previous books -well, no wonder with Oliver\'s werewolf-y family giving this larger-than-life vibe - ...\r\nOh shit!! That\'s funny\r\n\r\n... but the character- aaaand relationship-development is all I could have wished for. Okay, after some serious consideration of booty-smacking Oliver (code word for kicking him in the a.. umm, backside) for clamming up like an oyster and being secretive about his past all over again, mind you. Although, in the end it all made sense to me. Cooper was his trademark brave, snarky, hilarious self...\r\nPack wars, lone wolves with mysterious grudges and hostile takeovers... oh my.\r\nAnd Park had the audacity to tease him for comparing it to the movies. He\'d arrived in Guess Who\'s Coming to Dinner and woken up from an unexpected intermission in The Godfather.\r\n\r\n... and yet I wanted to hug him something fierce. I loved that he - both of them, actually - showed their vulnerable side here. Their love. Their determination to make this relationship work, no matter what.\r\n\r\nOh, and I was so groping in the dark in terms of the perp, it\'s not even funny. I should definitely work on my detective skills...\r\n\r\nI don\'t need to tell you that this was my favorite in this series, do I? Yeah well, I just did and am I content now? Nope, I. WANT. MORE. Please tell me there is more???!!! *whines* ', '2021-12-10', 7, 22),
(40, 'I love it', 'My favorite of the series! Hands-down best.\r\n\r\nThe thriller, the crime mystery, the creepy factor - all of it perfect.\r\n\r\nThe PNR aspect was more present in this one than the previous ones. Cooper and Oliver still don\'t know each other all that well, even after they\'ve been through so much together. There is so much to learn about the other.\r\n\r\nOliver\'s grandfather, alpha leader of the Park pack is dead. Oliver and Cooper head to the family home for the funeral. It should have been a quick trip there and back. But things start to go wrong even before they arrive. With a power vacuum in the pack, a killer on the loose and a party of squirrely scientists nosing around in the woods, it soon turns into a complicated situation for our BSI agents. It doesn\'t help that Oliver is acting strange.\r\n\r\nI pretty much kept a low level of anger against Oliver during the whole story. I felt bad for Cooper. He had to navigate a minefield. But finally, Oliver admitted \"You’ve seen the worst of me. You are the best of me.\"\r\n\r\nI really loved it! ', '2021-12-10', 7, 22),
(41, 'Recommend ', 'Wow, I really loved this book! I’m going into book 2 right away.\r\n\r\nHighly recommend for werewolve shifter fans. No insta-love-you´re-my-mate business. Not that I don’t like that every once in awhile.\r\n\r\nLove!', '2021-12-10', 9, 20),
(42, '', 'Well, well, well.\r\n\r\nI must say that the reviews raving about this book aren’t wrong.\r\n\r\nLaw enforcement tropes are a top favorite and when you mix it with werewolf shifter lore on a whole new set up, this definitely scratched every itch I had and some I didn’t even know about.\r\n\r\nEager FBI agent, recently transferred to a top secret branch known as the Bureau of Special Investigations, Cooper doesn’t quite know how to handle his new world view. Werewolves exist. This is still a well kept secret to the general population but that doesn\'t mean human and werewolf relations can take a backseat. When the top brass on both sides express displeasure in how suspected crimes done by werewolves are handled, Cooper’s the lucky guy that gets to spearhead a new partnership… with an actual werewolf.\r\n\r\nCue immediate distrust, throw in a little resentment, and toss liberally with a whole lot of needing to prove oneself as Cooper, and his new partner Park, head up north to investigate a couple of suspicious deaths. Cooper doesn’t want to like Park, but he can’t dismiss that having someone with extra sensory abilities covering his back, is not such a bad thing after all. As these two race against time, as both werewolves and humans start to go missing, they find things are way more complicated and shocking than they ever expected.\r\n\r\nOverall, this was filled with plenty of suspense, in and amongst a delicious slow burn between two men basically not communicating their vulnerabilities but not being able to fully hide their attraction. On a side note, Park was an absolute dream - mysterious, confident, an unruffled professional until he’s well and properly ruffled, a charming alpha with a protective streak, and a strong sense of justice and just this side of controlled dominance to melt your clothes off. Unf!!\r\n\r\nSo the short of it is, I definitely likened this to the other ultimate FBI couple that I love so hard, and when you throw in the shifter dynamic, it was the proverbial icing on the cake. Though this irked me quite a bit regarding Cooper’s understandable insecurities, the top notch romantic progression, peppered with some spot on snark, tender feels, and yummy smexy, all but negated those quibbles. I can only hope this continues to deliver and becomes a long standing series that I’ll enjoy far far into the future! Fingers crossed!', '2021-12-10', 9, 20),
(43, '3.5 stars', 'I have mixed feelings about this book. At times I was bored; other times engrossed. For too long a chunk of the story I disliked the MC, Cooper Dayton (or Dayton Cooper? Two last names for a name had me chronically confused). He seemed mean-spirited, which isn\'t an easy flaw for me to forgive. The other MC, Park, seen only through Cooper\'s POV, was mostly an enigma to me.\r\n\r\nBut there\'s one thing I don\'t have mixed feelings about, and it\'s this: Charlie Adhara is a real talent, an author to be excited about. Sure, her debut novel had some pacing issues, some characterization issues, but damn can she write. Cooper\'s internal dialogue was quirky and distinctive, and there were so many interesting little turns of phrase that I occasionally found myself laughing out loud just at the joy of seeing something expressed in a fresh and original way.\r\n\r\nI\'m at a loss as to whether to round this up to 4 stars, or down to 3. Out of appreciation for a promising new author, I\'d like to round up; to honestly compare it to other books on my shelves, I should round down. Also, as far as my personal enjoyment goes, the relationship between Cooper and Park had a D/s aspect to it, which is something I have a strong aversion to. It made me set the book aside for a while before I was ready to grit my teeth and pick it up again. So, 3 stars it is -- but it\'s a very upbeat, optimistic 3 stars, and I\'m looking forward to seeing more by this author.', '2021-12-10', 9, 20),
(44, 'AUDIO REVIEW ONLY', 'A first for me but enough is enough!! I\'m going to have to start reviewing some of the audios separately. I don\'t know what\'s up with having inexperienced narrators narrating popular book series. It makes no sense to me!!\r\n\r\nI gave up after 2 chapters because it sounded like someone reading a text book. HORRIBLE!!!\r\n\r\nI\'ll have to put this series on the back burner until I have time to read it or if it gets re-recorded.', '2021-12-10', 9, 20),
(45, 'I love it', 'Is it possible for your whole body to grin? The answer is hell yes.\r\n\r\nRed, White & Royal Blue is a story lit up like a beacon to the weary and the lost. My heart still swells with so much delight. I know the words but none of them really encompass the feeling of deep contentment, mixed with the kind of frustration one feels at waking from a sweet, joyous dream. I promise you that what memories you will keep of this book will warm you in the cold, and taste like candied almonds when the world runs sour. Do not miss it.\r\nSo, what’s this book about?\r\n\r\n\r\nAh, yes. The one trope that sings to me the most: rivals to “ugh I can’t believe I have to be in the same vicinity as you” to “ugh we\'re forced to work together to save our countries\' reputations but it’s not like I like you or anything” to “wait, we actually connect pretty well and have a lot of things in common but don\'t read too much into it” to “I would lay down both of my kidneys for you but that doesn’t mean anything alright” to “I’ll fistfight the moon for you and kill anyone who dares lay a finger on you” to lovers.\r\n\r\nAlex Claremont-Diaz, the Mexican-American first son of the United States, tolerates Henry, the Prince of England, to about the same degree that Henry tolerates him, but the claws are never entirely sheathed. When one of their verbal sparring matches ends in a “cataclysmically, internationally, terrible way”, Alex and Henry have no choice but to play nice with each other. Of course, building a friendship with your sworn nemesis is never easy. Doing it out of a reluctant sense of obligation is virtually impossible. Only, neither Alex nor Henry are prepared for when it all ceases being pretend. There is no pretending away the momentous thing tentatively taking shape between them. Henry has worn at the shell surrounding Alex’s heart with every traded truth, every phone call at an ungodly hour and every stolen moment in a hotel room. And with every crack, it is harder to deny the connection blazing between them.\r\n\r\nYet, all the same, reality threatens to shatter it all.\r\n\r\n“Do you feel forever about him?”\r\nAnd there’s no room left to agonize over it, nothing left to do but say the thing he is known all along. “Yeah,” he says, “I do.”\r\n\r\n\r\nRed, White & Royal Blue is an astonishingly polished debut novel. A beguiling story of romance that pulled a smile from a new place in me where so much delight had been waiting in reserve. The novel’s warm heart leaped out to my cold one, and I held on like I suspected this all of being a dream that’s about to end and leave me falling. I found myself drawing out the last 50 pages or so, absolutely unable, unwilling, to let this joyous incredible book go.\r\n\r\nThe rumors are true, folks: I am a hopeless romantic.\r\n\r\nAll I want is for someone to feel for me some glimmer of what Henry and Alex feel for each other. To find that one person who has so much aching tenderness for you, who you can talk to and emerge each time a bit less bewildered, a bit more yourself. The one person who will help you lay the skeins of your life out neatly, so there’d be less of a tangle in your heart. Just the sheer joy of simply knowing another human being.\r\n\r\nThere’s such a flood of love spooling out between Henry and Alex, tender and joyful and pure. I love how Alex had glided into love unaware, not knowing if it was love or just a suchlike cousin. Then, he plummeted, and it was unmistakable. And all the while, Henry has been there, with a lit cinder of hope in his gaze, and the calm resignation to the inevitable that you’d associate with people aching with the yearning to be loved back.\r\n\r\nWhen Alex was a kid, before anyone knew his name, he dreamed of love like it was a fairy tale, as if it would come sweeping into his life on the back of a dragon one day. When he got older, he learned about love as a strange thing that could fall apart no matter how badly you wanted it, a choice you make anyway. He never imagined it’d turn out he was right both times.\r\n\r\n\r\nHenry deserves the world, but the world doesn’t deserve him. Nothing will ever be more hilarious to me than the fact that Henry’s character, when translated by Alex’s gaze in the beginning, is this unbearably supercilious heir, vigorously bearded with an air of having been grudgingly forced into court elegance, whose body is hardened into armor and whose smiles are pickled things. But then that image quickly melts away, revealing this achingly compassionate person whom the stars would be so proud to know their atoms have created someone like him.\r\n\r\nI love Henry so much. His entire life, he had sailed upon the quiet ripple of his parents’ lives, struggling against the confines of family and legacy and creating a life all his own. But there was so much gold in him, the shine dimmed by years of telling himself there was something wrong with the way he was made. The enormity of this burden was so great it almost wore Henry out, and it smote my heart. But seeing him later embrace the certainty that he’s deserving of compassion and kindness and understanding—it genuinely made me at once gutted and filled with unspeakable tenderness for him. I’m so glad Alex was there to help him see the aspects of his being that were in darkness even to him and give him hope before he had even considered hope to be possible.\r\n\r\n“Take anything you want and know you deserve to have it.”\r\n\r\n\r\nSpeaking of Alex. I love him. That’s it. That’s the whole statement.\r\n\r\nAlex is all fragility with a front of strength. He’s exactly how his heart defines him: strong, gentle and unstoppable. His nature is bonfire, beaming like a beacon, burning like a wildfire out of control. He cares, and hopes, and dreams that, with his earnest work and efforts, grain by grain, the gray would give way to the dream and the sands of the world would shine bright. With Alex, the author has created such a vibrantly human protagonist whose perspective you can understand and whose candor, thoughtful strength, humanity, and resolve you can admire. His journey snagged at my heart and left me feeling like a witness to a very remarkable moment in his life, overwhelmed with gratitude for sharing it.\r\n\r\nI also love how the author handles with great aplomb a bisexual character who realizes, accepts and embraces his bisexuality in his twenties, just as well as they handle the burgeoning romance between him and Henry. Even side characters here are just as carefully conceived—I love Alex’s crew so much and there’s not much I wouldn’t give for a spin-off series centering each one of them.\r\n\r\nRed, White & Royal Blue also succeeds with brilliance and verve in addressing issues about racism, gender, responsibility, and ethics. I can’t tell you how much I enjoyed the cheeky undercurrent flowing through the novel—the arched eyebrow, the bold and confiding voice. It was all so glorious. As glorious at the fact that this book, at its heart, is a joyful celebration of the people who work so hard to carve out a place for themselves in a world that gives them freely to everyone else—those who are told that their dreams do not match where they came from and would therefore never be realized, those who love and believe in spite of odium and condemnation. As a queer Muslim immigrant, this meant so much more than words could possibly convey.\r\n\r\nThinking about history makes me wonder how I’ll fit into it one day, I guess. And you too. I kinda wish people still wrote like that. History, huh? Bet we could make some.\r\n\r\n\r\nThis is genuinely one of the best—if not the best—romance novels that I’ve ever read. I know I keep saying love is fake, but reading this book melted my cold dead heart. I’m a believer again! And you know what, although I have always been incapable of choosing a \"favorite book,\" I now know that if I had to be stuck on a desert island, with only one book to bring with me, it would definitely be this on', '2021-12-10', 9, 7),
(46, '', 'I am a soulless void.\r\n\r\nI have definitely said this before, but I don’t know if you’ve really HEARD me. And they say actions speak louder than words, so here I am.\r\n\r\nTaking this book, which everyone has hailed as pure joy / cookie-level sweetness / the greatest romance of our generation even though it’s fictional / overall so happiness-bringing it seems like it should be relegated to black market dealings…\r\n\r\nRereading it...and dropping a three point five rating (already gives a Scrooge-like aura of grumpiness) to...two point five. (DON’T HURT ME.)\r\n\r\nAnd generally being so discombobulated and displeased that I have to write a whole new review.\r\n\r\n(If you know anything about me, you know I am too lazy to write multiple reviews of one book unless the circumstances are truly life-ending-ly dire. That’s where we’re at.)\r\n\r\nThis just. Did not do it for me.\r\n\r\nLet’s talk about why, in bullet points, so as to hopefully limit my wordiness and therefore limit how mad at me you guys will be (please don’t yell at me I am already heartless and depressed):\r\n\r\n- THE ROMANCE: First time I read this, I felt like the human equivalent of a waffle. Sweet and fluffy and, uh, delicious. (I didn’t have a third one.) This time, the plot (which is just romance) never grabbed my attention, and the cheesy love story...grated. (Get it? Because cheese? Come on, now you can’t yell at me. That was too good.)\r\n\r\n- THE SMUT: Okay, I’ll admit this is personal preference. I don’t like when there’s too much smut in a book. That’s a me problem, however, and usually I will remedy it by just not reading it. However if I had skipped all explicit scenes in this book, I would only have a pamphlet trying to get me to join the fictional perfect glorified Democratic Party in my hands. (But more on that later.) Anyway, a romance that is 99% either sexting or sex is not convincing or fun for me. Sorry.\r\n\r\n- THE CHARACTERS: I love Bex or Bea (I think it’s Bea), and I love Henry’s friend whose name I can’t remember (is it Pez? Or is that just a candy), I love June and Nora so much I would marry them, and also remember their names, which is apparently high praise for me. Henry and Alex, however...I hate very much. They are annoying. Alex is obnoxious and made me feel like either a) a person with a hangover yelling at the still-drunk people to shut up or b) a grumpy old man telling snot-nosed children from the 1950s to get out of his yard. Henry is just boring.\r\n\r\n- THE POLITICS: This is, by far, the WORST thing about this book. It’s what got my first read to drop from presumably 5 to 3.5. Single-handedly. And it’s even more gruesome the second time. This is the most idealized, grotesque, good-versus-evil look at politics I have EVER SEEN. In this book, the Democrats are a rainbow-wearing gloriously diverse coalition of kumbaya-singing angels, and everyone else is a villain we won’t talk about. Democrats are 100% motivated purely by the love of Doing The Right Thing, and they have never done anything wrong, ever, in their lives. The American people love them implicitly and will turn historically red states blue just to show them that.\r\n\r\nIt’s not only sickening, it’s damaging. DO NOT IDEALIZE POLITICIANS. THEY ARE NOT CELEBRITIES. Don’t you think I want to get EMMA + AOC tattooed on my lower back? I do. But I won’t because she is a person who is driven to power, and all of those people have flaws.\r\n\r\nIn the interest of full transparency, I am a leftist, so I by definition think the Democrats are a little better than the Republicans. But I mostly think that glorifying parties is f*cked up and wrong, and results in things like sainting Pelosi and falling in love with Fauci and generally being unable to hold people accountable for doing their job (which is representing you), and therefore results in corruption and useless politicians and the end of the world.\r\n\r\nDramatic enough for a stopping point?\r\n\r\nBottom line: Before you guys start yelling at me, can anyone refer me to a good dentist? I got a cavity in every tooth from how saccharine this book is.\r\n\r\n--------------------\r\nreread pre-review\r\n\r\nrounding this rating down because the overall political fanfiction vibe is a lot harder to ignore on round 2.\r\n\r\npotential updated review to come / was 3.5 stars, might be 3 now\r\n\r\n----------\r\nreread updates\r\n\r\nstarting the year as i mean to go on: buddy reading with lily\r\n\r\n--------------------\r\noriginal review\r\n\r\nTHIS IS THE CUTEST FLUFFIEST BOOK ON THE FACE OF THE PLANET.\r\n\r\nThis made me...blush? And I famously cannot blush. One time my high school English teacher overheard me saying I didn’t do the assigned reading and he called me out in front of the whole class, and I, like a tiny badass (pretending my heart wasn’t pounding and I wasn’t more nervous than I’ve ever been), was like “Yeah, I’m not trying to hide anything. I didn’t do the reading.” And he, taken aback, went, “...You’re not even blushing.”\r\n\r\nSo, to recap: me, a school-obsessed profoundly shy 15-year-old being called out in front of all her very cool peers by her scary old man teacher = no blushing.\r\n\r\nThe sheer adorableness of this book = Blush City, population me.\r\n\r\nCASEY MCQUISTON IS A STAR.\r\n\r\nThis book has:\r\n- amazing banter\r\n- the best side characters\r\n- fantastic friendships\r\n- so much humor (I laughed! At a book! When does that HAPPEN!)\r\n- tons of angst (actually too much angst sometimes - I got a little tired of this book towards the end)\r\n- a great meet cute (except not actually a meeting. A re-meet-cute? Can I coin a term?)\r\n- the best idea for a forbidden / enemies-to-lovers romance EVER!!! No exaggeration.\r\n\r\nSo, in short, Casey McQuiston is, after just one book, a complete auto-buy author for me.\r\n\r\nHowever.\r\n\r\nThis was not a perfect book. And in truth it made me cringe many times.\r\n\r\nLike, yes, on the one hand everyone is right and this is the cutest, fluffiest, most fun read of all time.\r\n\r\nOn the other hand...I do not want my politics to be cute-fluffy-fun. I do not want them to be revisionist history where the current administration is absurdly well motivated and diverse and perfect and there is no corruption or back-hallway negotiation at all. It’s not realistic and to be honest, it makes me cringe.\r\n\r\nIf I wanted an idealized-to-the-point-of-unbelievability fictional American president, I’d watch the West Wing and ignore the bigoted parts.\r\n\r\nI also think the scene with the Queen of England was Cringe Central. Again, not realistic, just completely good politics versus completely bad politics depending on which better serves the plot.\r\n\r\nThis just felt...very juvenile. And I’m not saying that romance novels need to have the best ever take on politics. I’m not even saying that I was reading this book FOR the politics.\r\n\r\nAll I’m saying is...I care about politics and seeing it idealized and completely unrealistic took me out of the story??\r\n\r\n(Can I say the word politics more.)\r\n\r\nAnyway. Even that was not enough to take away from this book so much for it to be a negative rating or an unenjoyable read.\r\n\r\nBut...it was a takeaway. (SORRY.)\r\n\r\nBottom line: Casey McQuiston give me your next book immediately please, and also thank you for not writing it about politics. (OKAY I’M DONE USING THE WORD POLITICS NOW.)\r\n\r\n--------------------\r\noriginal pre-review\r\n\r\nnothing but respect for MY (alternate reality where the fictional president from this book is the actual) president', '2021-12-10', 9, 7),
(47, 'I enjoy this book', 'This book is amazing', '2021-12-14', 11, 3),
(50, 'Great!!!!!', 'great', '2021-12-14', 11, 7),
(51, 'I love it', 'testng', '2021-12-14', 12, 7);

